*, *:before, *:after {
  box-sizing: inherit;
  -webkit-tap-highlight-color: transparent;
  -moz-tap-highlight-color: transparent;
}

html, body, #q-app {
  width: 100%;
  direction: ltr;
}

body.platform-ios.within-iframe, body.platform-ios.within-iframe #q-app {
  width: 100px;
  min-width: 100%;
}

html, body {
  margin: 0;
  box-sizing: border-box;
}

article,
aside,
details,
figcaption,
figure,
footer,
header,
main,
menu,
nav,
section,
summary {
  display: block;
}

/* * line 1: Remove the bottom border in Firefox 39-.
 * * lines 2,3: Add the correct text decoration in Chrome, Edge, IE, Opera, and Safari.
 * */
abbr[title] {
  border-bottom: none;
  text-decoration: underline;
  text-decoration: underline dotted;
}

img {
  border-style: none;
}

svg:not(:root) {
  overflow: hidden;
}

/* * line 1: Correct the inheritance and scaling of font size in all browsers.
 * * line 2: Correct the odd `em` font sizing in all browsers.
 * */
code, kbd, pre, samp {
  font-family: monospace, monospace;
  font-size: 1em;
}

/* * lines 1,2: Add the correct box sizing in Firefox.
 * * line 3: Show the overflow in Edge and IE.
 * */
hr {
  box-sizing: content-box;
  height: 0;
  overflow: visible;
}

button,
input,
optgroup,
select,
textarea {
  font: inherit;
  font-family: inherit;
  margin: 0;
}

optgroup {
  font-weight: bold;
}

/* * Show the overflow in IE.
 * *  input: Show the overflow in Edge.
 * *  select: Show the overflow in Edge, Firefox, and IE.
 * * Remove the inheritance of text transform in Edge, Firefox, and IE.
 * *  select: Remove the inheritance of text transform in Firefox.
 * */
button,
input,
select {
  overflow: visible;
  text-transform: none;
}

button::-moz-focus-inner, input::-moz-focus-inner {
  border: 0;
  padding: 0;
}

button:-moz-focusring, input:-moz-focusring {
  outline: 1px dotted ButtonText;
}

fieldset {
  padding: 0.35em 0.75em 0.625em;
}

/**
 * * lines 1,3,4,6: Correct the text wrapping in Edge and IE.
 * * line 2: Correct the color inheritance from `fieldset` elements in IE.
 * * line 5: Remove the padding so developers are not caught out when they zero out
 * *    `fieldset` elements in all browsers.
 * */
legend {
  box-sizing: border-box;
  color: inherit;
  display: table;
  max-width: 100%;
  padding: 0;
  white-space: normal;
}

progress {
  vertical-align: baseline;
}

textarea {
  overflow: auto;
}

input[type=search] {
  -webkit-appearance: textfield;
}

input[type=search]::-webkit-search-cancel-button,
input[type=search]::-webkit-search-decoration {
  -webkit-appearance: none;
}

.q-icon {
  line-height: 1;
  width: 1em;
  height: 1em;
  letter-spacing: normal;
  text-transform: none;
  white-space: nowrap;
  word-wrap: normal;
  direction: ltr;
  text-align: center;
  position: relative;
  box-sizing: content-box;
  fill: currentColor;
}
.q-icon:before, .q-icon:after {
  width: 100%;
  height: 100%;
  display: flex !important;
  align-items: center;
  justify-content: center;
}
.q-icon > svg {
  width: 100%;
  height: 100%;
}

.q-icon,
.material-icons,
.material-icons-outlined,
.material-icons-round,
.material-icons-sharp {
  user-select: none;
  cursor: inherit;
  font-size: inherit;
  display: inline-flex;
  align-items: center;
  justify-content: center;
  vertical-align: middle;
}

.q-panel {
  height: 100%;
  width: 100%;
}
.q-panel > div {
  height: 100%;
  width: 100%;
}

.q-panel-parent {
  overflow: hidden;
  position: relative;
}

.q-loading-bar {
  position: fixed;
  z-index: 9998;
