  @for $pos from 0 through 11
    $angle: (270 + 30 * $pos)
    $top: (1 + sin($angle))
    $left: (1 + cos($angle))
    &__clock-pos-#{$pos}
      top: toFixed(percentage($top * 0.5), 100)
      left: toFixed(percentage($left * 0.5), 100) #{"/* rtl:ignore */"}
  @for $pos from 12 through 23
    $angle: (270 + 30 * $pos)
